#popup {
    position: absolute;
    text-align: center;
    background: rgba(0, 0, 0, .85);
    width: 100%;
    display: block;
    top: 0;
    left: 0;
    height: 100%;
    padding-top: 50px;
    padding-bottom: 100px;
    z-index: 999;
}

#popup img {
    border: 10px solid #fff;
    border-radius: 30px;
}


/*#popup_img{display:none}*/

#close {
    right: 23px;
    position: fixed;
    top: 20px;
    text-align: center;
    padding: 3px 2px 3px;
    line-height: 1;
    color: #000;
    font-size: 30px;
    font-weight: normal;
    z-index: 999;
    cursor: pointer;
    font-family: inherit;
    background: white;
    border-radius: 50%;
    width: 40px;
    height: 40px;
    cursor: pointer;
}

.hos_modal img {
    max-width: 100%
}


