    z-index: 99999999
}

.share-tools--floater .popup-menu {
    left: -11px
}

.share-tools.share-tools--main .popup-menu {
    right: -11px
}

.share-tools.share-tools--main .popup-menu:before {
    left: auto;
    right: 15px
}

.share-tools .popup-menu .icon:last-child {
    margin-right: 0
}

.share-tools--floater {
    position: absolute;
    margin-left: -74px;
    width: 36px;
    display: none;
    -webkit-transform: translateZ(0)
}

.share-tools--floater .icon,
.share-tools--floater .icon:first-child {
    margin: 0 8px 7px 0
}

.share-tools--floater .popup-menu .icon:first-child {
    margin: -8px 8px 0 0
}

