.main-banner {
    position: relative;
    background-color: #fff;
    width: 100%;
    margin: 0 auto!important;
    z-index: 9999999;
    text-align: left;
    border-top: 1px solid;
    border-bottom: 1px solid;
    border-color: #e6e6e6
}

.main-banner .container {
    position: relative;
    width: 1140px;
    padding-right: 20px;
    padding-left: 20px;
    margin-right: auto;
    margin-left: auto
}

.container-lts {
    position: relative;
    background: white;
    box-sizing: content-box;
    height: 55px;
    padding: 20px 0;
    margin: 0 auto;
    transition: padding .2s, height .2s
}

.main-banner-logo {
    position: relative;
    height: 100%
}

.main-banner-logo>a {
    float: left;
    display: block;
    position: relative;
    height: 100%;
    width: 55px;
    transition: width .2s
}

.main-banner-logo>a:last-child {
    margin-left: 5px
}

.main-banner-logo .cnn-logo {
    position: relative;
    height: 100%!important;
    width: auto;
    transition: height .2s
}

.main-banner-logo .tech-logo {
    position: absolute;
    height: 21px;
    width: 50px;
    top: 50%;
    transform: translateY(-50%)
}

.main-banner .main-nav {
    position: absolute;
    top: 50%;
    right: auto;
    left: 175px;
    transform: translateY(-50%)
}

.main-banner .main-nav-li {
    float: left;
    list-style: none;
    cursor: pointer;
    font-weight: 400
}

.main-banner .main-nav-a {
    position: relative;
    display: inline-block;
    color: #7e7e7e;
    text-decoration: none;
    text-transform: uppercase;
    letter-spacing: 3px;
    font-family: 'SourceSansPro';
    font-size: 14px;
    font-weight: 600;
    margin: 0 20px
}

.main-banner .main-nav-a:after {
    content: '';
    position: absolute;
    bottom: -12px;
    height: 3px;
    width: 0;
    left: 50%;
    background-color: #00bdef;
    transition: width .2s, left .2s
}

.main-banner .main-nav-a:hover,
.main-banner .main-nav-a:focus {
    color: #222
}

.main-banner .main-nav-a:hover:after,
.main-banner .main-nav-a:focus:after {
    left: 0;
    width: 100%
}

.main-banner .tech-social {
    position: absolute;
    width: 126px;
    right: 34px;
    height: 100%
}

.main-banner .tech-social--ul {
    list-style: none;
    position: absolute;
    top: 50%;
    transform: translateY(-50%)
}

.main-banner .tech-social--li {
    display: inline-block;
    vertical-align: middle;
    margin: 0 5px
}

.main-banner .tech-social--li>a {
    display: block;
    position: relative;
    color: #00bdef;
    height: 28px;
    width: 28px;
    border: 1px solid #00bdef;
    border-radius: 28px;
    transition: color .2s, background .2s
}

.main-banner .tech-social--li>a:hover,
.main-banner .tech-social--li>a:focus {
    color: white;
    background: #00bdef;
    text-decoration: none
}

.main-banner .tech-social--li i {
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%)
}

.main-banner-right {
    position: absolute;
    top: 50%;
    display: block!important;
    transform: translateY(-50%);
    right: 0
}

.main-banner .search {
    top: 50%;
    right: 0;
    width: 28px;
    height: 28px;
    border-radius: 28px;
    border: 1px solid #00bdef;
    transition: all .2s
}

.main-banner .search .icon--search-tech {
    position: absolute;
    top: 50%;
    z-index: 50;
    height: 28px;
    width: 28px;
    border-radius: 28px;
    transform: translateY(-50%);
    right: 0
}

.main-banner .search .icon--search-tech {
    color: #00bdef;
    transition: color .2s
}

.main-banner .search .icon--search-tech:before {
    position: absolute;
    top: 50%;
    right: 6px;
    transform: translateY(-50%)
}

.main-banner .search:hover .icon--search-tech {
    color: white
}

.main-banner .search:hover {
    background: #00bdef
}

.main-banner .search input[type='text'] {
    position: absolute;
    width: 0;
    right: 0;
    top: 50%;
    transform: translateY(-50%);
    padding: 0;
    border: 0;
    height: 100%;
    background: transparent;
    transition: width .2s
}

.main-banner svg #path-1,
.main-banner svg #Fill-1,
.main-banner svg #Fill-4,
.main-banner svg #Fill-6 {
    fill: #00bdef;
    transition: fill .2s
}

