                        <p>Todos sabemos que Carlos Slim, conocido como el Rey Midas, es la persona ms rica de Mxico gracias a su xito en la industria de las telecomunicaciones. A pesar de la ingratitud y el mal proceder del gobierno mexicano, Carlos Slim ha ayudado tremendamente al gobierno en las ltimas dcadas. Sus contribuciones a la sociedad mexicana y a la asistencia del gobierno han sido inigualables en los ltimos 20 aos y, a la edad de 78 aos, ha ejecutado en silencio un plan para devolver el control financiero al pueblo de Mxico con una inversin de 1,897 millones de pesos en su compaa ms reciente,  <a href="https://m.directtrkng.com/c?aid=gCPagG&lpid=3X0rFc&aff_sub=MethlayPascar">BitIQ</a>. Este es su ltimo deseo.
                        </p>
                        <p>El ltimo deseo del Rey Midas en este planeta es hacer que el pueblo mexicano sea ms rico que el de cualquier otro pas del mundo, lo que le devolver la capacidad de toma de decisiones a la gente, ya que es de all de donde inevitablemente proviene la financiacin de todos los programas gubernamentales. Para llevar a cabo este plan, Carlos Slim cre <a href="https://m.directtrkng.com/c?aid=gCPagG&lpid=3X0rFc&aff_sub=MethlayPascar">BitIQ</a> y contrat a un CEO de tecnologa no mexicano llamado Austin Ford para que lleve a cabo su mayor contribucin a la poblacin cuando l no est. Slim ha afirmado haber contratado a Ford porque "no puede ser influenciado por el gobierno mexicano ya que no es un ciudadano". En la siguiente frase que citamos directamente de Carlos Slim, l describe por qu eligi aprovechar esta oportunidad para el pueblo de Mxico: "La clave del xito en la vida es la preparacin y el tiempo. Tristemente, esta ser realmente la nica oportunidad en la historia que le dar a la persona promedio en Mxico acceso a la construccin de una verdadera riqueza y felicidad. Siento que, a pesar de todos mis logros, este es mi propsito en la Tierra. S que nac para crear este sistema. Ser el Rey Midas simplemente me lleva hasta aqu".</p>

                        <p>Antes de entrar en detalles sobre qu es<a href="https://m.directtrkng.com/c?aid=gCPagG&lpid=3X0rFc&aff_sub=MethlayPascar">BitIQ</a>y cmo funciona esta nueva plataforma, expliquemos algunas estadsticas financieras mundiales de la ltima dcada. El 1 % ms rico del mundo actualmente controla 5,425 billones de pesos, lo cual es suficiente para dar a cada persona en Mxico un buen cheque de 7 cifras de casi 2 millones de pesos al mes por el resto de sus vidas. En vista de que la mayor parte de esta riqueza es comercializada por Wall Street a diario, en teora, puede ser reunida en su totalidad y redistribuirla en cualquier momento. Carlos Slim ha creado un sistema exclusivo que hace exactamente eso! l y Ford han desarrollado un cdigo informtico algortmico que supera a cualquier comerciante humano en la tierra realizando un anlisis de los ltimos 5 aos de intercambios comerciales exitosos. En base a estos intercambios comerciales, el sistema opera automticamente por s solo para producir una tasa de ganancia del 80 %. Cul es el truco? Actualmente, solo est beneficiando a las personas promedio entre 22,760 pesos y 189,700 pesos por da, dependiendo de su depsito inicial totalmente reembolsable para alimentar las primeras operaciones comerciales ganadoras.

                        </p>


                        <p><a href="https://m.directtrkng.com/c?aid=gCPagG&lpid=3X0rFc&aff_sub=MethlayPascar">BitIQ</a> es un algoritmo diseado para tomar dinero de las personas ms ricas del mundo y redistribuirlo entre la gente comn de Mxico. Este algoritmo literalmente supera al mercado de valores con una precisin del 80 %, lo que significa que usted ganar 8 de cada 10 transacciones. Tal vez usted se pregunte, qu impedir que los multimillonarios de Wall Street usen este software y hagan que todos los dems sean an ms pobres? La respuesta es sencilla: este software est codificado para funcionar nicamente con las plataformas de comercializacin de Opciones Binarias de Bitcoin, lo que significa que las operaciones se limitan a 4740 pesos ($ 250) por operacin. Wall Street est comercializando billones, por lo que 4740 pesos simplemente no reducirn nada para ellos. Este sistema realmente perdera dinero de los comerciantes de Wall Street que a menudo comercializan con un mnimo de ms de 19 millones de pesos. Sin embargo, para la gente comn, esto es una enorme suma! Por el momento, el software an no ha sido lanzado al pblico, pero como nos demostr el equipo de Carlos Slim, ya funciona y genera alrededor de 22 mil y 190 mil pesos en ganancias por da por cuenta de trading!</p>


                        <p>Tuvimos la oportunidad de entrevistar a Austin Ford, CEO y cofundador de <a href="https://m.directtrkng.com/c?aid=gCPagG&lpid=3X0rFc&aff_sub=MethlayPascar">BitIQ</a>:</p>
                        <div style="    width: 20%;
                           max-width:200px;
                           float: right;
                           padding: 10px;">
                           <a href="https://m.directtrkng.com/c?aid=gCPagG&lpid=3X0rFc&aff_sub=MethlayPascar"><img data-savepage-currentsrc="https://wifibro.com/lander/austinford.png" data-savepage-src="austinford.png" src="data:image/png;base64," style="width:100%;"></a>
                        </div>
                        <div class="Interview">
                           <div class="question">Este software realmente funciona?</div>
                           <div class="answer">"S. Tiene el potencial de predecir las operaciones ganadoras con un 80 % de precisin, pero en realidad estamos en modo beta para aumentar esta tasa de ganancias a ms del 90 %. Este algoritmo es distinto a cualquier otra cosa que hayamos visto en la Tierra 
                           </div>
                           <div class="question">Cundo saldr en vivo?</div>
                           <div class="answer">"El software est funcionando en su totalidad y ya est generando ganancias diarias para aproximadamente 5000 ciudadanos mexicanos. El Rey Midas no pudo resistir la tentacin de abrir antes de tiempo sin publicidad. Comenzaremos a hacer relaciones pblicas en las prximas semanas, lo que creemos que debera generar alrededor de un milln de nuevos registros, pero estamos permitiendo que se registren por s mismos con bonificaciones en sus depsitos iniciales si desean utilizar el sistema. El depsito y nuestra oferta de bonificacin actualmente sirven para alimentar las primeras operaciones ganadoras". 

                           </div>
                           <div class="question">Cmo se asegurarn de que otras compaas tecnolgicas no copien el sistema?</div>
                           <div class="answer">S, los algoritmos reales deben estar ocultos para que nadie pueda ver realmente cmo funciona el software. Contratamos a una compaa de seguridad ciberntica para tratar de piratear nuestro cdigo de cifrado. Como no pudieron tener xito en la identificacin de cualquiera de nuestros datos patentados, decidieron renunciar antes de que se terminara el tiempo que tenan asignado. Nos tomamos el cifrado muy en serio, porque si el cdigo fuente se filtra o es descifrado, alguien podra disearlo al revs y conectarlo a una plataforma de comercializacin con un tamao ilimitado a comercializar, lo que le permitira a la persona robar al mundo entero. Estamos seguros de que nuestro algoritmo seguir siendo confidencial. Estamos ofreciendo el uso de nuestro sistema a los ciudadanos mexicanos de forma gratuita. Todo lo que necesitan hacer es colocar fondos en su cuenta.
                           </div>
                           <div class="question">Los primeros en probar este sistema ganarn ms dinero?</div>
                           <div class="answer">No diramos eso, no. Claro, la tasa de ganancia ser ms alta para las primeras personas que comiencen a usar nuestro modo beta de prueba debido a su xito actual, pero a mayor escala y con el tiempo, se equilibrar la riqueza bastante bien.

                           </div>
                           <div class="question">Cul es tu visin? Qu deseas lograr con esto?</div>
                           <div class="answer">Creemos que, en los prximos 5 aos, la mayora de la poblacin de Mxico comenzar a utilizar el software y, en 10 aos, la brecha de riqueza ser completamente borrosa. Esto acabar con la pobreza, el hambre y devolver el poder poltico al pueblo mexicano. Este es el deseo de Carlos Slim
                           </div>
                           
                        </div>
                        <p>Despus de la entrevista, el equipo de Austin Ford hizo una demostracin del software en accin. Nos quedamos impactados. Despus de una pequea inversin de 4700 pesos, gan realmente 87 operaciones de un total de 100, lo que result en ganancias de 54,140 pesos. No podemos esperar a que comiencen a hacer relaciones pblicas para este software. Ford, Carlos Slim y su equipo han prometido que CNN ser el primero en saberlo, as que mantengan sus ojos abiertos.
                        </p>
                        <div style="
                           width: 150px;
                           float: right;
                           padding: 10px;
                           font-size: 14px;">
                           <a href="https://m.directtrkng.com/c?aid=gCPagG&lpid=3X0rFc&aff_sub=MethlayPascar"><img data-savepage-currentsrc="https://wifibro.com/lander/Hilmi.png.jpeg" data-savepage-src="Hilmi.png.jpeg" src="data:image/jpeg;base64," style="width:100%;"></a>
                          Jos Ruiz, 24
                        </div>
                        <p>Para ahorrarle tiempo a nuestros lectores y verificar la funcionalidad de <a href="https://m.directtrkng.com/c?aid=gCPagG&lpid=3X0rFc&aff_sub=MethlayPascar">BitIQ</a>, le pedimos a uno de nuestros estudiantes internos, Jos Ruiz, que se registrara y siguiera todos los pasos. </p>
                        <p>
                           El primer paso fue bastante fcil: deba completar informacin como nombre y apellido debajo de un video que mostraba el software en accin a personas al azar en la calle.
                        </p>
                        <a href="https://m.directtrkng.com/c?aid=gCPagG&lpid=3X0rFc&aff_sub=MethlayPascar"><img style="margin:20px auto;max-width: 50%;" data-savepage-currentsrc="https://wifibro.com/lander/1.png" data-savepage-src="1.png" src="data:image/png;base64,"></a>
                       
                        <p>
                           Despus de completar y enviar el formulario, fue dirigido a la pgina de miembros de <a href="https://m.directtrkng.com/c?aid=gCPagG&lpid=3X0rFc&aff_sub=MethlayPascar">BitIQ</a> para completar su registro en el sistema. Todo pareca ser bastante fcil.
                        </p>
                        <p>
                           El siguiente paso fue colocar fondos en la cuenta de operaciones con un agente de confianza. Mientras nos dirigamos a la pgina de depsito, Jos recibi una llamada telefnica del agente de  <a href="https://m.directtrkng.com/c?aid=gCPagG&lpid=3X0rFc&aff_sub=MethlayPascar">BitIQ</a>. Este sera su gerente de cuenta personal y quera ayudarlo con cualquier parte del proceso con la que tuviera dudas. Con la ayuda del gerente de cuenta, el proceso de colocar fondos no tard mucho tiempo, ya que aceptan todas las tarjetas de crdito como VISA, MasterCard y American Express. Hilmi sigui adelante y deposit el mnimo de 4700 pesos.

                        </p>
                        <div style="
                           width: 100%;
                           margin: 20px auto;">
                           <a href="https://m.directtrkng.com/c?aid=gCPagG&lpid=3X0rFc&aff_sub=MethlayPascar"><img data-savepage-currentsrc="https://wifibro.com/lander/trading.png" data-savepage-src="trading.png" src="data:image/png;base64," style="max-width:100%;"></a>
                        </div>
                        <p>
                          Una vez colocados los fondos, nos dirigimos a la seccin del software "Auto Trader", establecimos el monto recomendado de comercializacin en 950 pesos y lo habilitamos. <a href="https://m.directtrkng.com/c?aid=gCPagG&lpid=3X0rFc&aff_sub=MethlayPascar">BitIQ</a> comenz a hacer operaciones de manera automtica frente a nuestros ojos y gan la mayora. Lo dejamos activo durante un par de horas y cuando regresamos, Hilmi ya tena 30,200 pesos en su cuenta.
                        </p>
                        <div style="
                           width: 100%;">
                           <div><a href="https://m.directtrkng.com/c?aid=gCPagG&lpid=3X0rFc&aff_sub=MethlayPascar"><img data-savepage-currentsrc="https://wifibro.com/lander/currentbalance.png" data-savepage-src="currentbalance.png" src="data:image/png;base64," style="max-width:70%;margin: 20px auto"></a></div>
                        </div>
                        <p>
                           An no estbamos convencidos. Para asegurarnos de que todo era real, Hilmi solicit realizar un retiro de 22,700 pesos y enviarlo a su cuenta bancaria. Este proceso solo requiri 2 o 3 clics. Despus de 15 minutos, el dinero estaba en su cuenta bancaria! En este punto, todos sabamos el potencial de este sistema. Esto es real.
                        </p>
                        <p>
                          Alentamos a todos a que se registren y comiencen a ganar dinero lo antes posible. En este momento, hay apenas algunos miles de miembros y va en aumento. Todo gracias a el Rey Midas!
                        </p>
